  false,\n\t\"url\": null,\n\t\"notes\": \"The Knudsen 2620 acquired sub-bottom profiles
  continuouslyn               throughout the cruise. The Knudsen was operated in 3.5
  kHz Chirp mode, emitting a 1.5n               kHz to 5 kHz (3 kHz bandwidth centered
  on 3.5 kHz) pulse from transducers mounted inn               the pod beneath the
  hull. A record window of 100 or 200 meters and assumed soundn               velocity
  of 1500 m/s remained constant through the cruise, except for areas wheren               topographic
  variation dictated a >200meter record window. The resulting datan               records
  were 131 or 261 msec long, with a sample interval 0.038 msec. The ping raten               varied
  over the course of the cruise, generally between 4 and 6n               seconds.\",\n\t\"owner_org\":
